import React, { Component } from "react";
import { StyleSheet, View, TouchableOpacity, Text } from "react-native";
import IoniconsIcon from "react-native-vector-icons/Ionicons";

function Bar(props) {
  return (
    <View style={[styles.container, props.style]}>
      <View style={styles.rectStack}>
        <View style={styles.rect}>
          <View style={styles.iconRow}>
            <IoniconsIcon name="md-trophy" style={styles.icon}></IoniconsIcon>
            <IoniconsIcon name="ios-flag" style={styles.icon2}></IoniconsIcon>
          </View>
        </View>
        <TouchableOpacity style={styles.button}>
          <Text style={styles.e3}>E</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {},
  rect: {
    top: 36,
    left: 0,
    width: "100%",
    height: 62,
    position: "absolute",
    backgroundColor: "rgba(255,255,255,1)",
    borderRadius: 15,
    flexDirection: "row",
  },
  icon: {
    color: "rgba(128,128,128,1)",
    fontSize: 30,
    height: 33,
    width: 24,
  },
  icon2: {
    color: "rgba(128,128,128,1)",
    fontSize: 29,
    height: 32,
    width: 19,
    marginLeft: 292,
    marginTop: 1,
  },
  iconRow: {
    height: 33,
    flexDirection: "row",
    flex: 1,
    marginRight: 10,
    marginLeft: 15,
    marginTop: 14,
  },
  button: {
    top: 0,
    width: 71,
    height: 71,
    position: "absolute",
    backgroundColor: "rgba(242,163,101,1)",
    borderRadius: 100,
    alignSelf: "center",
  },
  e3: {
    fontFamily: "roboto-regular",
    color: "rgba(255,255,255,1)",
    marginTop: 28,
    marginLeft: 32,
  },
  rectStack: {
    width: "100%",
    height: 98,
  },
});

export default Bar;
